import React from "react";


const MenuItem = ({ paragraph }) => {
    return (
        <tr>
            <td>
                {paragraph.one}
            </td>
            <td>
                {paragraph.two}
            </td>
            <td>
                {paragraph.three}
            </td>
        </tr>
    )
}


const MenuList = ({ menu }) => {
    return (
        <table>
            {menu.map((paragraph) => <MenuItem paragraph={paragraph} />)}
        </table>
    )
}


export default MenuList;
